INSERT INTO `services` (`id`, `name`, `disp`, `icon`, `image`, `slug`, `is_active`, `created_at`, `updated_at`) VALUES
(5, 'Engine Repair', 'Engine repair is a vital automotive service aimed at restoring the functionality and performance of a vehicle\'s engine. Skilled technicians diagnose and address issues such as overheating, oil leaks, or mechanical failures that compromise engine efficiency. Through a combination of diagnostics, parts replacement, and meticulous repair work, engine repair ensures optimal operation, prolongs the engine\'s lifespan, and maintains vehicle safety. Whether it\'s repairing a minor issue or conducting a major overhaul, professional engine repair services are essential for maintaining the reliability and longevity of any vehicle, ensuring smooth rides and peace of mind for drivers.', 'uploads/service/icon/1708252593.png', 'uploads/service/img/1708252593.png', 'engine-repair', '1', '2024-02-18 05:06:33', '2024-02-18 05:06:33'),
(6, 'Periodic Service', 'Periodic service is a routine maintenance procedure crucial for keeping vehicles in optimal condition. Conducted at regular intervals as per manufacturer recommendations, it involves a comprehensive inspection and servicing of various vehicle components. Technicians perform tasks such as oil changes, filter replacements, fluid top-ups, tire rotations, and general system checks to identify potential issues early on. Periodic service not only ensures peak performance but also enhances safety, fuel efficiency, and overall longevity of the vehicle. By adhering to scheduled maintenance, drivers can minimize the risk of unexpected breakdowns and costly repairs, ensuring a smoother and more reliable driving experience.', 'uploads/service/icon/1708252785.jpg', 'uploads/service/img/1708252785.png', 'periodic-service', '1', '2024-02-18 05:09:45', '2024-02-18 05:09:45'),
(7, 'insurance claim', 'An insurance claim is a formal request made by a policyholder to their insurance company for coverage or compensation for a loss or damage covered by their insurance policy. This process typically involves providing documentation, such as a claim form and evidence of the loss or damage, to the insurance company for review. Once the claim is assessed and approved, the insurer may provide financial reimbursement or other forms of compensation to the policyholder to help mitigate the impact of the loss. Insurance claims play a crucial role in helping individuals or businesses recover from unforeseen events, providing financial protection and peace of mind.', 'uploads/service/icon/1708252887.jpg', 'uploads/service/img/1708252887.webp', 'insurance-claim', '1', '2024-02-18 05:11:27', '2024-02-18 05:11:27'),
(8, 'Battery Checkup', 'A battery checkup is a fundamental automotive service aimed at assessing the health and functionality of a vehicle\'s battery. During this procedure, technicians inspect the battery for signs of wear, corrosion, or damage, as well as test its voltage and overall performance. They may also examine the battery connections and terminals for any issues that could affect its operation. A thorough battery checkup helps identify potential problems early on, preventing unexpected breakdowns and ensuring reliable starting power for the vehicle. Regular battery checkups are essential for maintaining vehicle safety, performance, and longevity, especially in extreme weather conditions.', 'uploads/service/icon/1708253004.jpg', 'uploads/service/img/1708253004.png', 'battery-checkup', '1', '2024-02-18 05:13:24', '2024-02-18 05:13:24'),
(9, 'Denting Painting', 'Denting and painting services are essential automotive procedures focused on repairing and refinishing vehicle bodywork. Skilled technicians assess the extent of damage, which may include dents, scratches, or paint chips, and devise a suitable repair plan. The denting process involves reshaping or smoothing out damaged areas to restore the original contours of the vehicle body. Subsequently, the painting stage entails applying primer, paint, and clear coat to seamlessly match the existing finish or achieve a desired color. Denting and painting services not only enhance the aesthetic appeal of the vehicle but also protect it from corrosion and structural damage, ensuring a pristine appearance and prolonged lifespan.', 'uploads/service/icon/1708253129.jpg', 'uploads/service/img/1708253129.png', 'denting-painting', '1', '2024-02-18 05:15:29', '2024-02-18 05:15:29'),
(10, 'AC Service', 'AC service for cars is a crucial maintenance procedure aimed at ensuring optimal performance and comfort within the vehicle\'s cabin. Skilled technicians inspect the air conditioning system for leaks, worn-out components, or refrigerant levels that may affect cooling efficiency. They may also clean or replace air filters to improve air quality and circulation. Additionally, the service includes checking the compressor, condenser, and evaporator for any issues that could hinder cooling capacity. By conducting regular AC service, drivers can enjoy consistent and efficient cooling during hot weather, enhancing their overall driving experience and passenger comfort.', 'uploads/service/icon/1708253302.jpg', 'uploads/service/img/1708253302.png', 'ac-service', '1', '2024-02-18 05:18:22', '2024-02-18 05:18:22'),
(11, 'Tyre replacement', 'Tyre replacement is a vital automotive service focused on replacing worn-out or damaged tyres with new ones to ensure optimal performance, safety, and handling of the vehicle. Skilled technicians assess the condition of the tyres, looking for signs of wear, tread depth, and any visible damage such as punctures or cracks. Based on their evaluation, they recommend suitable replacement tyres that match the vehicle\'s specifications and driving needs. By installing new tyres, drivers can enhance traction, braking, and stability, especially in adverse road conditions, thus promoting overall road safety and extending the lifespan of their vehicle.', 'uploads/service/icon/1708253432.jpg', 'uploads/service/img/1708253432.png', 'tyre-replacement', '1', '2024-02-18 05:20:32', '2024-02-18 05:20:32'),
(12, 'Basic Service', 'Engine oil 3.5L (Normal Oil)\r\n\r\nAc filter Cleaned\r\nOil filter Cleaned\r\nAir filter Cleaned\r\ngenral checkup\r\nWashing', 'uploads/service/icon/1708444636.png', 'uploads/service/img/1708444636.jpg', 'basic-service', '1', '2024-02-20 10:27:16', '2024-02-20 10:27:16'),
